import React from 'react';
import logo from './logo.svg';
import './App.css';

class App extends React.Component {

  constructor(props){
    super(props);
    this.state = {
      data: 'data'
    }
  }

  generateTypeA = () => {
    let open, close = 3;
    let result = '';
    while (open !== 0 || close !== 0) {
      if (open < close) {
        result = result.concat('(')
      } else {
        result = result.concat(')')
      }
    } ;
    console.log('generateTypeA', result)
    this.generateTypeB();
    this.setState({
      data: result
    }) 
  }
  generateTypeB = () => {
    let open, close = 3;
    let result = '';
    while (open !== 0 || close !== 0) {
      if (open !== 0) {
        result = result.concat('(')
      } else {
        result = result.concat(')')
      }
    }
    console.log('generateTypeB', result)
  }
  render() {
    return (
      // <div >
      //     <h1>{this.state.data}</h1>
      //     <p
      //     onClick={this.generateTypeA()}
      //     >
      //       Learn React
      //   </p>
      // </div>
      <div className="App">
        <header className="App-header">
          <img src={logo} className="App-logo" alt="logo" />
          <p>
            Edit <code>src/App.js</code> and save to reload.
        </p>
          <a
            className="App-link"
            href="https://reactjs.org"
            target="_blank"
            rel="noopener noreferrer"
          >
            Learn React
        </a>
        </header>
      </div>
    );
  }
}

export default App;
